        if ($('#tags').val()) {
            typingTimer = setTimeout(doneTyping, doneTypingInterval);
        }
    });

    //user is ""finished typing,"" do something
    function doneTyping() {
        $(""#tags"").autocomplete({
            source: namesWithLabels,
            select: function (event, ui) {
                $('#producerId').val(ui.item.id);
                $('#tags').val(ui.item.label);
            }
        });
    }
</script>
